import React from 'react';

const ContactPage = () => {
  return (
    <div>
      <h1>Контакты</h1>
      <p>Свяжитесь с нами по телефону или электронной почте.</p>
      {/* Добавьте здесь дополнительную информацию и элементы формы */}
    </div>
  );
};

export default ContactPage;
